alse,\"taskDescription\":\"<h3>a) In document 1, tomatoes grow outside soil. In what part of the plant does absorption of water and mineral salts take place? Justify your answer.</h3>\\n\",\"remainingChars\":\"Remaining characters: @chars\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"e7d52583-96e7-4d0c-8354-7b0960480bcb\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\",\"title\":\"Untitled Text input field editor element\"}},{\"params\":{\"inputFieldSize\":\"10\",\"requiredField\":false,\"taskDescription\":\"<h3>b) Observe document 2 and describe the experiment.</h3>\\n\",\"remainingChars\":\"Remaining characters: @chars\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"52da4eb4-f688-429d-b993-5ea4ae4a1c76\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\",\"title\":\"Untitled Text input field editor element\"}},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"taskDescription\":\"<h3>c) The hairs on the young roots that are observed under a magnifier are called <strong>absorbing root hairs</strong>. Why is that?</h3>\\n\",\"remainingChars\":\"Remaining characters: @chars\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"210819c6-6d11-406d-a100-d31c1b603e55\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\",\"title\":\"Untitled Text input field editor element\"}},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"taskDescription\":\"<h3>d) What can you conclude?</h3>\\n\",\"remainingChars\":\"Remaining characters: @chars\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"26d1280a-525a-4a28-bfb6-3c0a35739294\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\",\"title\":\"Untitled Text input field editor element\"}}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"92247ac4-d155-4eb1-a1c6-7eb706a67b82\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Questions\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Questions\"}},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>Your answer must include the following:</p>\\n\\n<p>a) Tomatoes grow outside soil.</p>\\n\\n<p>Their roots are dipped in containers filled with nutritive solution.</p>\\n\\n<p>The absorption of water and mineral salts takes place at the roots of a plant.</p>\\n\\n<p>b) 3 small plants are soaked in tubes containing water and oil. The plants are composed of leaves, stems, and roots with hairs. </p>\\n\\n<ul>\\n\\t<li>The root of plant A soaks entirely in water.</li>\\n\\t<li>The root of plant B has its extremity in oil while its root hairs soak in water.</li>\\n\\t<li>The root of plant C has only its extremity in water while its root hairs soak in oil.</li>\\n</ul>\\n\\n<p>3 days later: plants A and B are green and show a normal growth while plant C is yellow and wilting. </p>\\n\\n<p>c) Absorption of water and mineral salts is carried out by the <strong>root hairs</strong>. This is why we call them absorbing root hairs. </p>\\n\\n<p>d) Plants draw water and mineral salts through their roots. This absorption is carried out by the root hairs. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"subContentId\":\"30916741-f597-4070-9935-99855ce95fee\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"f310957c-07f1-4fcf-8ac8-2568f95b80a6\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Try to answer before checking here.\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Try to answer before checking here.\"}}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"subContentId\":\"7dab2247-9f21-4348-9fea-9e67488d84bf\",\"metadata\":{\"title\":\"Documentation tool\",\"license\":\"U\",\"contentType\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation tool\"}},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.15","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"Absorption of Water and Mineral Salts","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.AdvancedText-1.1/text.js?version=1.1.14","/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.TextInputField-1.2/text-input-field.js?version=1.2.13","/h5p/libraries/H5P.TextInputField-1.2/xapi-generator.js?version=1.2.13","/h5p/libraries/H5P.Text-1.1/scripts/text.js?version=1.1.17","/h5p/libraries/H5P.StandardPage-1.5/standard-page.js?version=1.5.15","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-score-bar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progressbar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-ui.js?version=1.3.19","/h5p/libraries/H5P.DocumentationTool-1.8/navigation-menu.js?version=1.8.24","/h5p/libraries/H5P.DocumentationTool-1.8/documentation-tool.js?version=1.8.24","/h5p/libraries/H5P.Column-1.15/scripts/h5p-column.js?version=1.15.2"],"styles":["/h5p/librarie
